import React,{Component} from 'react';

import './Home.css';
import Header from "../../common/header/Header";

class Home extends Component{

    render(){
        return(
            <div>
                <Header />
                <div>
                    <span>UpComing Movies..</span>
                </div>
            </div>
        )
    }
}

export default Home;
